import React from 'react';
import ReactDOM from 'react-dom';

document.addEventListener('DOMContentLoaded', function(){

    function LikeBoxFn(props) {
        return (
            <div>
                <p>{props.likes}</p>
                <button>like!</button>
            </div>
        )
    }

    class LikeBoxCl extends React.Component {
        render() {
            return (
                <div>
                    <p>{this.props.likes}</p>
                    <button>like!</button>
                </div>
            )
        }
    }
 
    ReactDOM.render(
        <div>
            <LikeBoxFn likes={22} />
            <LikeBoxCl likes={223} />
        </div>,
        document.getElementById('app')
    );
});
